import React from 'react';
import BiographyCard from './components/BiographyCard';
import Grid from '@material-ui/core/Grid';

function App() {
  return (
    <div>
    <Grid container spacing={1}>
    <Grid item xs={12}>
      <BiographyCard/>
      </Grid>
      </Grid>
    </div>
  );
}

export default App;
